import "./HeroImgStyles.css";

import React from 'react'

import IntroImg from "../assets/Intro-bg.jpg";

const Heroimg = () => {
  return (
    <div className="hero"> 
       <div className="mask"><img className="Intro-img" src={IntroImg} alt="IntroImg" /></div>
       
    </div>
  )
}

export default Heroimg
